MultiLanguageItemData['en'][66100] = {name = "Plans: Ebonsteel Belt Buckle", additional_info = "Binds when picked up\nRequires Blacksmithing (525)\n[q2]Use: Teaches you how to make an Ebonsteel Belt Buckle.\n\n\n[q3]Ebonsteel Belt Buckle\nRequires Level 80\n[q2]Use: Permanently attach an ebonsteel belt buckle onto a belt, adding a socket to the belt.\n\n Attaching the belt buckle causes the item to become soulbound. Cannot be used on items level 500 or higher.\nSell Price: \nRequires Volatile Earth (4), Elementium Bar (4), Pyrium Bar (4)"}
MultiLanguageItemData['en'][66101] = {name = "Plans: Pyrium Shield Spike", additional_info = "Binds when picked up\nRequires Blacksmithing (525)\n[q2]Use: Teaches you how to make a Pyrium Shield Spike.\n\n\n[q3]Pyrium Shield Spike\nBinds when equipped\nRequires Level 85\n[q2]Use: Attaches a Pyrium Spike to your shield that sometimes deals 210 to 350 damage when you block with it.\n\n Attaching a Pyrium Spike to your shield causes it to become soulbound.\nRequires Pyrium Bar (5)"}
